import React from "react";
import { NavLink } from "react-router-dom";

export default function Nav (){
  return (
    <nav>
      <NavLink exact to="/">
        Home
      </NavLink>
      <NavLink to="/">
        Job Search
      </NavLink>
      <NavLink exact to="/login">Sign In</NavLink>
      <NavLink exact to="/register">Sign Up</NavLink>
    </nav>
  );
}
